class WebRTCService {
  constructor(socket) {
    this.socket = socket;
    this.localStream = null;
    this.peerConnection = null;
    this.onRemoteStream = null;

    // STUN servers configuration
    this.configuration = {
      iceServers: [
        {
          urls: [
            "stun:stun1.l.google.com:19302",
            "stun:stun2.l.google.com:19302",
          ],
        },
      ],
    };
  }

  async startLocalStream() {
    try {
      console.log("Requesting user media...");
      const constraints = {
        audio: true,
        video: {
          width: { ideal: 1280 },
          height: { ideal: 720 },
          frameRate: { ideal: 30 }
        }
      };
      console.log("Media constraints:", constraints);

      this.localStream = await navigator.mediaDevices.getUserMedia(constraints);
      console.log("Got local stream:", this.localStream.getTracks());
      return this.localStream;
    } catch (error) {
      console.error("Error getting user media:", error);
      console.error("Error details:", {
        name: error.name,
        message: error.message,
        constraint: error.constraint
      });
      throw error;
    }
  }

  async createPeerConnection() {
    try {
      console.log("Creating peer connection with config:", this.configuration);
      this.peerConnection = new RTCPeerConnection(this.configuration);

      // 添加本地流
      if (this.localStream) {
        console.log("Adding local tracks to peer connection");
        this.localStream.getTracks().forEach((track) => {
          console.log("Adding track:", track.kind, track.label);
          const sender = this.peerConnection.addTrack(track, this.localStream);
          console.log("Track added with sender:", sender);
        });
      } else {
        console.warn("No local stream available when creating peer connection");
      }

      // 处理远程流
      this.peerConnection.ontrack = (event) => {
        console.log("Received remote track:", {
          kind: event.track.kind,
          label: event.track.label,
          streams: event.streams.length
        });

        if (this.onRemoteStream) {
          console.log("Setting remote stream");
          this.onRemoteStream(event.streams[0]);
        } else {
          console.warn("No remote stream handler set");
        }
      };

      // 处理 ICE 候选
      this.peerConnection.onicecandidate = (event) => {
        if (event.candidate) {
          console.log("New ICE candidate:", event.candidate);
          // ICE 候选通过 socket 发送给对方
          if (this.socket) {
            this.socket.emit("ice-candidate", {
              candidate: event.candidate,
            });
          }
        }
      };

      this.peerConnection.oniceconnectionstatechange = () => {
        console.log(
          "ICE connection state:",
          this.peerConnection.iceConnectionState
        );
      };

      return this.peerConnection;
    } catch (error) {
      console.error("Error creating peer connection:", error);
      throw error;
    }
  }

  async createOffer() {
    if (!this.peerConnection) {
      throw new Error("PeerConnection not initialized");
    }

    try {
      const offer = await this.peerConnection.createOffer({
        offerToReceiveAudio: true,
        offerToReceiveVideo: true,
      });

      console.log("Created offer:", offer);
      await this.peerConnection.setLocalDescription(offer);
      return offer;
    } catch (error) {
      console.error("Error creating offer:", error);
      throw error;
    }
  }

  async handleOffer(offer, fromId) {
    if (!this.peerConnection) {
      throw new Error("PeerConnection not initialized");
    }

    try {
      console.log("Handling offer:", offer);
      const rtcOffer = new RTCSessionDescription(offer);
      console.log("Created RTCSessionDescription from offer:", rtcOffer);

      await this.peerConnection.setRemoteDescription(rtcOffer);
      console.log("Set remote description successfully");

      const answer = await this.peerConnection.createAnswer();
      console.log("Created answer:", answer);

      await this.peerConnection.setLocalDescription(answer);
      console.log("Set local description successfully");

      return answer;
    } catch (error) {
      console.error("Error handling offer:", error);
      console.error("Error details:", {
        errorName: error.name,
        errorMessage: error.message,
        errorStack: error.stack,
      });
      throw error;
    }
  }

  async handleAnswer(answer) {
    if (!this.peerConnection) {
      throw new Error("PeerConnection not initialized");
    }

    try {
      await this.peerConnection.setRemoteDescription(
        new RTCSessionDescription(answer)
      );
    } catch (error) {
      console.error("Error handling answer:", error);
      throw error;
    }
  }

  async handleIceCandidate(candidate) {
    if (!this.peerConnection) {
      throw new Error("PeerConnection not initialized");
    }

    try {
      await this.peerConnection.addIceCandidate(new RTCIceCandidate(candidate));
    } catch (error) {
      console.error("Error handling ICE candidate:", error);
      throw error;
    }
  }

  closeConnection() {
    if (this.peerConnection) {
      this.peerConnection.close();
      this.peerConnection = null;
    }

    if (this.localStream) {
      this.localStream.getTracks().forEach((track) => track.stop());
      this.localStream = null;
    }
  }
}

export default WebRTCService;
